import './Homepage.css';
import InsightsIcon from '@mui/icons-material/Insights';
import { Button } from '@mui/material';

function Homepage() {
  return (
    <div className="App">
      <h1>The World's Most <br/>
      Powerful Event Ticketing <br/>
      Platform.</h1>

      <p>Nftikets is the complete solution to online ticketing for any type of live and <br/>
      virtual event</p>

      <div className='btn'>
        <Button variant="outlined" startIcon={<InsightsIcon />}>Explore</Button>
        <Button variant="outlined" startIcon={<InsightsIcon />} style="margin-left: 10px;">Join</Button>
      </div>
    </div>
  );
}

export default Homepage;
